import React, { Component } from "react";
import MainBanner from "./MainBanner";
import Packages from "./Packages";
import Destinations from "./Destinations";
import Blog from "./Blog";
import Features from "./Features";
import Review from "./Review";
import Achievement from "./Achievement";

//Define Default Content
class HomePage extends Component {

  constructor(props) {
    super(props);
    this.state = {
      isLoading: true
    };
  }

  componentDidMount() {
    setTimeout(() => {
      this.setState({ isLoading: false })
    }, 1500)
  }
  render() {
    return (
       <div>

           {/* Start Preloader Area */}
           {
          this.state.isLoading && <div className="preloader">
            <div className="loader loader1">
              <span style={{ '--i': 1 }} />
              <span style={{ '--i': 2 }} />
              <span style={{ '--i': 3 }} />
              <span style={{ '--i': 4 }} />
              <span style={{ '--i': 5 }} />
              <span style={{ '--i': 6 }} />
              <span style={{ '--i': 7 }} />
              <span style={{ '--i': 8 }} />
              <span style={{ '--i': 9 }} />
              <span style={{ '--i': 10 }} />
              <span style={{ '--i': 11 }} />
              <span style={{ '--i': 12 }} />
              <span style={{ '--i': 13 }} />
              <span style={{ '--i': 14 }} />
              <span style={{ '--i': 15 }} />
              <span style={{ '--i': 16 }} />
              <span style={{ '--i': 17 }} />
              <span style={{ '--i': 18 }} />
              <span style={{ '--i': 19 }} />
              <span style={{ '--i': 20 }} />

          

            </div>
          </div>
  }
           {/* End Preloader Area */}

           {/*---------Start Imported All Sections-----------*/}
            <MainBanner/>
            <Packages/>
            <Destinations/>
             <Achievement/>
             <Review/>
            <Features/>
            <Blog/>
           {/*---------End Imported All Sections-----------*/}
       </div>
    );
  }
}

export default HomePage;
